import React from "react";

const Main = () => {
  return (
    <div className="row justify-content-md-center">
      <div className="col-12 col-sm-4 pt-2">
        <div className="card p-3" >
        <div className="mb-3">
            <label className="col-form-label">Mesa</label>
            <input className="form-control" type="number" max="10" min="0"></input>
          </div>
          <div className="mb-3">
            <label className="col-form-label">Comida</label>
            <select className="form-select form-control">
              <option selected>Seleccione un plato</option>
            </select>
          </div>
          <div className="mb-3">
            <label className="col-form-label">Cantidad</label>
            <input className="form-control" type="number" min="0"></input>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Main;
